import styled from "styled-components";

export const Gallery_Container = styled.div`
  width: 100%;
  max-width: 1100px;
  margin: auto;
  position: relative;
  height: 100vh;
`;


export const Gallery_Wrapper = styled.div`
  display: grid;
  grid-template-areas: [column-start]"a""a" 50px[column-end]
 [column-start]"b""b" 50px[column-end];
  position: absolute;
  top: -10%;

/ auto 50px auto;
 
`;
